import React from 'react'
import './Home.css'

function Home() {
    return (
        <div className='home'>
            <div className="home_container">
                <img className="home_image"
                 src="https://resize.indiatvnews.com/en/resize/newbucket/1200_-/2020/04/amazon-prime-video-1585832033.jpg"/>
               
                </div>


        </div>
    )
}

export default Home
